import { RiMenu3Line, RiCloseLin} from 'react-icons/ri';
import './navbar.css';

const NavBar = () => {
  return (
    <div className="reshma__navbar">
      <div className="reshma__navbar-links">
        <div className="reshma__navbar-links_home">
          Reshma Gudla
        </div>
      </div>
    </div>
  )
}

export default NavBar
